var topX=topY=0,ew=88,e=[],n=document.createElement('div');function newRack(el){if(e.length>1){topX=e.length*ew;}n.id=el+'_rack';n.className='rack';n.style.cssText='left:'+topX+'px;top:'+topY+'px;';document.getElementsByTagName('body')[0].appendChild(n)}function jsElement(element){e.push(element);newRack(element)}